import styled from 'styled-components'

export const StyledMain = styled.section`

background-color: #FFFFFF;

.content{
    display: flex;
    justify-content: space-between;
    flex-shrink: 0;
    padding: 1em;
    
    height: 100%;

}

.myfridge{
    background-color: #F2F2F2;
    align-content: center;
    width: 20rem;
    text-align: center;
    padding-top: 15px;

    


}

.myrecipies{
    background-color: #F2F2F2;
    width: 23rem;
    text-align: center;
    padding-top: 15px;






}

.searchbar{

    background-color: #F2F2F2;
    width: 30rem;
}


`
